import React from 'react';
import landscape from '../utilities/landscape.jpg';
import './Article.css';
const Article = () => {
  return (
    <div className='article-container'>
      <img className='imgArea' src={landscape} alt='article-image' />
      <div class='category'>
        <span>אוכל</span>
      </div>
      <h2 className='title'>סיור קולינרי בין המסעדות</h2>
      <p className='subTitle'>
        גם אני שעסוק כל השבוע מתפנה לצפות בטלוויזה רק בסופי השבוע, ונוכחתי שרוב
        תוכניות האלוייזה בכל הערוצים הן תוכניות אוכל
      </p>
      <p className='authorname'>שירית גל</p>
    </div>
  );
};

export default Article;
